import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

import useAuth from '../hooks/useAuth.js';
import { loginUser } from '../services/authService.js';

function Login() {
  const navigate = useNavigate();
  const { login } = useAuth();
  const [form, setForm] = useState({ email: '', password: '' });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    setError('');
    setLoading(true);
    try {
      const response = await loginUser(form);
      login(response.token, response.user);
      navigate('/analyze');
    } catch (err) {
      setError(err.response?.data?.message || err.message || 'Credenciales inválidas.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <section className="auth-layout card">
      <h1 className="page-title">Bienvenido</h1>
      <div style={{ display: 'flex', flexDirection: 'row', gap: '2.5rem', alignItems: 'flex-start', justifyContent: 'center' }}>
        <article className="auth-illustration" style={{ minWidth: 280, maxWidth: 340, flex: '0 0 auto', background: '#f7f7fa', borderRadius: '1rem', padding: '1.5rem', boxShadow: '0 2px 8px #0001' }}>
          <p className="auth-kicker">Accede a tu cuenta</p>
          <ul className="auth-sample-list">
            <li>
              <span>Correo empresarial</span>
              <strong>Ejemplo: ana.martinez@tuempresa.com</strong>
            </li>
            <li>
              <span>Contraseña</span>
              <strong>TuClaveFuerte!2025</strong>
            </li>
          </ul>
          <p className="auth-sample-foot">
            Ingresa tus credenciales para continuar.
          </p>
        </article>
        <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', gap: '1rem', minWidth: 280, maxWidth: 340, flex: '0 0 auto' }}>
          <div className="form-group">
            <label htmlFor="email">Correo</label>
            <input id="email" name="email" type="email" value={form.email} onChange={handleChange} required />
          </div>
          <div className="form-group">
            <label htmlFor="password">Contraseña</label>
            <input id="password" name="password" type="password" value={form.password} onChange={handleChange} required />
          </div>
          {error && <p style={{ color: 'crimson' }}>{error}</p>}
          <button className="primary-btn" type="submit" disabled={loading}>
            {loading ? 'Ingresando...' : 'Entrar'}
          </button>
          <p style={{ textAlign: 'center', marginTop: '0.5rem' }}>
            ¿Nuevo usuario? <Link to="/register">Crea una cuenta</Link>
          </p>
        </form>
      </div>
    </section>
  );
}

export default Login;
